import React from "react";
import { motion } from "framer-motion";

const ProjectRacc = () => {
  return (
    <div className="bg-[#141414] text-white font-sans">
      {/* Hero Section */}
      <section className="h-screen flex flex-col justify-center items-center bg-gradient-to-b from-[#141414] to-[#1c1c1c]">
        <motion.h1
          className="text-5xl md:text-6xl font-bold text-white text-center"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 1 }}
        >
          RaccTracc: Enhancing Raccoon Appreciation at UCSD
        </motion.h1>
        <motion.p
          className="text-lg md:text-xl text-gray-300 mt-4 text-center"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.5 }}
        >
          A platform combining real-time tracking, education, and community for raccoon enthusiasts.
        </motion.p>
        <motion.div
          className="mt-8"
          initial={{ scale: 0 }}
          animate={{ scale: 1 }}
          transition={{ delay: 1 }}
        >
          <img
            src="placeholder-hero.png"
            alt="RaccTracc Mockup"
            className="rounded-lg shadow-lg w-3/4 md:w-1/2 hover:scale-105 transition-transform"
          />
        </motion.div>
      </section>

      {/* Project Overview */}
      <motion.section
        className="py-12 px-6 md:px-16"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        viewport={{ once: true }}
        transition={{ duration: 0.5 }}
      >
        <h2 className="text-4xl font-bold bg-gradient-to-r from-vibrant-blue to-vibrant-green bg-clip-text text-transparent">
          Project Overview
        </h2>
        <p className="text-gray-300 mt-4 leading-relaxed">
          RaccTracc is an innovative platform designed to bring the raccoon-loving community closer by offering interactive features like real-time tracking, educational resources, and collaborative tools. Inspired by the viral @ucsd.raccoons Instagram account, it elevates wildlife appreciation to new heights.
        </p>
        <p className="text-gray-300 mt-4 leading-relaxed">
          <strong>Role:</strong> UI/UX Designer & Developer
          <br />
          <strong>Duration:</strong> 8 Weeks
          <br />
          <strong>Tools:</strong> Figma, React, TailwindCSS
        </p>
      </motion.section>

      {/* Design Process */}
      <motion.section
        className="py-12 px-6 md:px-16 bg-gray-900"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        viewport={{ once: true }}
        transition={{ duration: 0.5 }}
      >
        <h2 className="text-4xl font-bold text-gradient bg-gradient-to-r from-vibrant-pink to-vibrant-yellow bg-clip-text text-transparent">
          Design Process
        </h2>
        <div className="mt-8 grid grid-cols-1 md:grid-cols-2 gap-8">
          <div>
            <h3 className="text-2xl font-bold text-white">Research Insights</h3>
            <p className="text-gray-300 mt-2">
              User interviews revealed a demand for real-time updates and educational content. Key insights informed the app's core features.
            </p>
          </div>
          <div>
            <img
              src="placeholder-research.png"
              alt="Research Findings"
              className="rounded-lg shadow-lg w-full"
            />
          </div>
          <div>
            <img
              src="placeholder-wireframes.png"
              alt="Wireframes"
              className="rounded-lg shadow-lg w-full"
            />
          </div>
          <div>
            <h3 className="text-2xl font-bold text-white">Wireframes & Iterations</h3>
            <p className="text-gray-300 mt-2">
              Iterative testing and feedback cycles ensured a user-friendly experience. Wireframes mapped key user journeys.
            </p>
          </div>
        </div>
      </motion.section>

      {/* Final Design */}
      <motion.section
        className="py-12 px-6 md:px-16"
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        viewport={{ once: true }}
        transition={{ duration: 0.5 }}
      >
        <h2 className="text-4xl font-bold bg-gradient-to-r from-vibrant-blue to-vibrant-pink bg-clip-text text-transparent">
          Final Design
        </h2>
        <p className="text-gray-300 mt-4 leading-relaxed">
          The final design incorporates vibrant visuals, intuitive navigation, and seamless functionality. Explore the interface highlights below.
        </p>
        <div className="mt-8 grid grid-cols-1 md:grid-cols-3 gap-6">
          <img
            src="placeholder-design1.png"
            alt="Final Design 1"
            className="rounded-lg shadow-lg"
          />
          <img
            src="placeholder-design2.png"
            alt="Final Design 2"
            className="rounded-lg shadow-lg"
          />
          <img
            src="placeholder-design3.png"
            alt="Final Design 3"
            className="rounded-lg shadow-lg"
          />
        </div>
      </motion.section>

      {/* Call to Action */}
      <section className="text-center py-12 bg-gradient-to-t from-[#141414] to-[#1c1c1c]">
        <a
          href="#"
          className="px-6 py-3 text-lg font-bold text-white bg-vibrant-green rounded-lg shadow-md hover:bg-vibrant-blue transition-colors"
        >
          Explore RaccTracc
        </a>
      </section>
    </div>
  );
};

export default ProjectRacc;
